taskSetItem.script1:
var e1 = ee.getEditText(ee.getControl("edit25"));    //起始时间
var e2 = ee.getEditText(ee.getControl("edit26"));    //截至时间
//var e2 = ee.getEditText(ee.getControl("edit2"));
//发送
eio.appendInt32(g5.pageSize);
eio.appendInt32(g5.pageCurrent);
eio.appendString16(e1);
eio.appendString16(e2);

taskSetItem.script2:
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var e1 = eio.readString16();
var e2 = eio.readString16();

//产生条件语句 where accountName='" + db.encode(session.get("username")) + "'
var condition = "where 1=1";
if (e1!="" &amp; e2!="") {
    condition += " and (regDatetime between ' "+ db.encode(e1) + "'and '" + db.encode(e2) + "')";
}
//if (e2>0) {
//    condition += " and mobile = " + e2;
//}

var sql, sqlResult;

//获取记录数量
sql = "select count(*) as c from activeUserLog " + condition;
sqlResult = db.executeQuery("PJ", sql);
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

//读取表
sql =
    "SELECT  id,regDatetime,studentDay1,studentDay2,studentDay3,studentDay5,studentDay7,studentDay10,studentDay15,studentDay20,studentDay30, "+
    "coachDay1,coachDay2,coachDay3,coachDay5,coachDay7,coachDay10,coachDay15,coachDay20,coachDay30, "+
    "cast(coachDay30 as nvarchar) +'`'+cast(studentDay1+coachDay1 as nvarchar) +'`'+ cast(studentDay3+coachDay3 as nvarchar) +'`'+ "+
    "cast(studentDay5+coachDay5 as nvarchar)+'`'+ cast(studentDay7+coachDay7 as nvarchar) +'`'+"+ 
    "cast(studentDay15+coachDay15 as nvarchar) +'`'+ cast(studentDay20+coachDay20 as nvarchar) +'`'+ "+
    "cast(studentDay30+coachDay30 as nvarchar) as data " +
    " from activeUserLog " +
    condition +" order by  regDatetime ";  
//es.logWarning(sql);    
sqlResult = db.executeQuery("PJ", sql);
eio.appendInt32(count);
eio.appendDataSet(sqlResult, "id,regDatetime,studentDay1,studentDay3,studentDay5,studentDay7,studentDay15,studentDay20,studentDay30,coachDay1,coachDay3,coachDay5,coachDay7,coachDay15,coachDay20,data", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody2"), g5.dataset1, 0);
ee.setText(ee.getControl("layoutxitem45"), g5.pageCurrent + "/" + g5.pageCount);
